    to the payment made on March 11th.  The lease with Broderick Building, LLC came
    up for renewal and the Committee re-negotiated the contract.  The debt from the
    prior contract was absorbed as part of the re-nogitation agreement.  Therefore,
    since no debt exists per the new lease, the Committee credited the debt on the
    Schedule D to reflect this.   In addition, the IE expenditure for CD04 was incorrectly
    disclosed on the May payment to Thompson Signs.  The Committee has corrected the
    entry so that it correctly discloses on this report with the April Thompson Signs
    payment.  Please note that employees of the Committee that spent less than 25%
    of their time on Federal Election Activity were paid on the Schedule H4 uniform
    split.  Expenditures listed on Line 21B did NOT meet the definition of Federal
    Elections Activity. In addition, all fundraising, event, and related payments
    made during this period were Committee fundraising and not on behalf of a Federal
    Candidate.   Please also note that the payments to Newman Partners are based on
    a contractual set amount per month without regard to the percentage of funds raised.
    \ Due to the contractual agreement, the FEC Reports Analysis Supervisor has ruled
    that the payments qualify as Admin instead Fundraising and may be reported on
    Schedule H4.\n"
